import firebase from 'firebase'
import Vue from 'vue'
import App from './App'

Vue.config.productionTip = false

// Initialize Firebase
var config = {
  apiKey: "AIzaSyDnKnlSgDfGOxObGWPJMaI1zTomBJDqhU8",
  authDomain: "twitter-chat-app.firebaseapp.com",
  databaseURL: "https://twitter-chat-app.firebaseio.com",
  projectId: "twitter-chat-app",
  storageBucket: "twitter-chat-app.appspot.com",
  messagingSenderId: "682863789860",
  appId: "1:682863789860:web:7b2eae44772140d2"
}

firebase.initializeApp(config)


/* eslint-disable no-new */
new Vue({
  render: h => h(App),
}).$mount('#app')
